import React, { Component } from "react";
import Header from "./Header";

export default class Upload extends Component {
  render() {
    return (
      <div className="upload">
        <Header />
        <p id="titleText">Upload Video</p>
        <div className="upload__video">
          <p id="uploadText">VIDEO THUMBNAIL</p>
          <video />
          <lable id="uploadText">TITLE YOUR VIDEO</lable>
          <input />
          <lable id="uploadText">ADD A VIDEO DESCRIPTION</lable>
          <textarea />
        </div>
        <button className="upload__button">PUBLISH</button>
        <button className="upload__button">CANCEL</button>
      </div>
    );
  }
}
